import React from 'react';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import styles from './index.css';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

const Home = () => {
  return (
    <div class="grid-container" style={{display:'flex',alignItems:'center',height:'50vh'}}> 
        <div class="grid-item">
            <div style={{border:'1px solid red'}}>
                <h2>Motor Form</h2>
                <TextField id="outlined-basic" label="Motor Number" variant="outlined"/>
                <TextField id="outlined-basic" label="Part Number" variant="outlined"/>
                <Button variant="contained">ADD MOTOR</Button>
            </div>
            <div>
                Motor data table
            </div>
        </div>
        <div class="grid-item">
            <div style={{border:'1px solid red'}}>
                <h2>Battery Form</h2>
                <TextField id="outlined-basic" label="Motor Number" variant="outlined"/>
                <TextField id="outlined-basic" label="Part Number" variant="outlined"/>
                <Button variant="contained">ADD BATTERY</Button>
            </div>
            <div>
                Battery data table
            </div>
        </div>

    </div>
  )
}

export default Home;
